import React,{ Component } from 'react';
import dchannel from "../img/dchannel.jpg";
import {Link} from "react-router-dom";
import { FaLongArrowAltLeft,FaMinus,FaPlus } from 'react-icons/fa';
class Register extends Component{
    render() {
        return(

            <div className="wrap">
                <div className="container">
                    <div className="login">
                        <div className="title-bar">
                            <p>Login</p>
                        </div>
                        <div className="form-content">
                            <p className="text-right"><a href=" ">Login with Email</a></p>
                            <form className="form">
                                <input type="text" name="" placeholder="Email" required=""/>
                                <div className="phone">
                                    <select>
                                        <option>+95</option>
                                        <option>+01</option>
                                        <option>+067</option>
                                    </select>
                                    <input type="text" name="" placeholder="Phone No" required=""/>
                                </div>
                                <input type="password" name="" placeholder="Password" required=""/>
                                <button className="btn-com"><a href="dashboard.html"
                                                               className="cl-white">Login</a></button>
                            </form>
                            <p className="text-right">New User?<a href="">Register</a></p>
                        </div>
                    </div>
                </div>

            </div>
        );
    }
}
export default Register;
